import React from "react";
import { Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import Used from "./components/Used"; // Example page
import Products from "./components/Products"; // Your default page
import VirtualShowroom from "./components/VirtualShowroom"; // Other pages
import Service from "./components/Service";
import TCare from "./components/TCare";
import BuyOnline from "./components/BuyOnline";
import ToyotaIndia from "./components/ToyotaIndia";

function App() {
  return (
    <div>
      <Navbar /> {/* Always visible */}

      {/* Define the Routes */}
      <Routes>
        <Route path="/" element={<Products />} /> {/* Default page */}

        <Route path="/service" element={<Service />} />
        <Route path="/t-care" element={<TCare />} />
        <Route path="/used-cars" element={<Used />} />
        <Route path="/buy-online" element={<BuyOnline />} />
        <Route path="/toyota-in-india" element={<ToyotaIndia />} />
      </Routes>
    </div>
  );
}

export default App;
